   "source": [
    "suppressPackageStartupMessages({\n",
    "    library(tidyverse)\n",
    "    library(cluster)\n",
    "    library(factoextra)\n",
    "})\n",
    "\n",
    "# 1. Загрузка\n",
    "# Ссылка ведет на датасет CC GENERAL.csv\n",
    "# Попробуем найти его в папке (обычно на Kaggle он лежит в /kaggle/input/ccdata/CC GENERAL.csv)\n",
    "# Но для универсальности поищем\n",
    "\n",
    "df <- read.csv(\"/kaggle/input/ccdata/CC GENERAL.csv\")\n",
    "\n",
    "# 2. Предобработка\n",
    "# Удаляем ID\n",
    "df_clean <- df %>% select(-CUST_ID)\n",
    "\n",
    "# Заполняем пропуски (медианой, чтобы не терять данные)\n",
    "df_clean <- df_clean %>% mutate(across(everything(), ~ifelse(is.na(.), median(., na.rm=TRUE), .)))\n",
    "\n",
    "# Масштабирование (обязательно для Евклида)\n",
    "df_scaled <- scale(df_clean)\n",
    "\n",
    "# 3. Кластеризация (Hierarchical: Single Linkage)\n",
    "# Считаем матрицу расстояний (Euclidean)\n",
    "dist_mat <- dist(df_scaled, method = \"euclidean\")\n",
    "\n",
    "# Строим дерево\n",
    "hc_single <- hclust(dist_mat, method = \"single\")\n",
    "\n",
    "# 4. Визуализация Дендрограммы\n",
    "options(repr.plot.width = 16, repr.plot.height = 8)\n",
    "\n",
    "# Рисуем\n",
    "fviz_dend(hc_single, \n",
    "          k = 4, # Попробуем выделить 4 цвета, но single скорее всего покажет 1 гигантский\n",
    "          show_labels = FALSE, # Иначе будет каша из 9000 подписей\n",
    "          main = \"Дендрограмма (Single Linkage + Euclidean)\",\n",
    "          rect = TRUE)\n",
    "\n",
    "# 5. Выводы (автоматический анализ высоты)\n",
    "cat(\"\\n=== Анализ структуры ===\\n\")\n",
    "cat(\"Метод 'Single Linkage' часто приводит к эффекту цепочки.\\n\")\n",
    "cat(\"Посмотрим на распределение высот объединения:\\n\")\n",
    "print(head(rev(hc_single$height), 10)) # Топ-10 последних объединений\n"
   ]
  },
