    "# Вариант 1: Самый простой и надежный (Base R)\n",
    "options(repr.plot.width = 20, repr.plot.height = 10)\n",
    "\n",
    "# Просто строим, без наворотов\n",
    "plot(hc_single, \n",
    "     main = \"Dendrogram (Single Linkage)\", \n",
    "     xlab = \"Customers\", \n",
    "     sub = \"\",\n",
    "     labels = FALSE,  # Убираем текст снизу, чтобы не вис\n",
    "     hang = -1)       # Выравниваем ножки\n",
    "     \n",
    "# Добавляем красные рамки (попробуем выделить 3 кластера)\n",
    "rect.hclust(hc_single, k = 3, border = \"red\")\n"
   ]
