   "source": [
    "suppressPackageStartupMessages({\n",
    "    library(tidyverse)\n",
    "    library(cluster)\n",
    "    library(factoextra)\n",
    "    library(mclust)\n",
    "})\n",
    "\n",
    "df <- read.csv(\"/kaggle/input/ship-performance-clustering-dataset/Ship_Performance_Dataset.csv\")\n",
    "\n",
    "# Оставляем только числа для кластеризации и масштабируем\n",
    "df_numeric <- df %>% \n",
    "    select(Speed_Over_Ground_knots, Engine_Power_kW, Distance_Traveled_nm, \n",
    "           Operational_Cost_USD, Revenue_per_Voyage_USD, Efficiency_nm_per_kWh) %>%\n",
    "    na.omit()\n",
    "X_scaled <- scale(df_numeric)\n",
    "\n",
    "# 2. Строим дендрограммы (Евклид и Манхэттен + Ward)\n",
    "options(repr.plot.width = 16, repr.plot.height = 8)\n",
    "\n",
    "d1 <- dist(X_scaled, method = \"euclidean\")\n",
    "hc1 <- hclust(d1, method = \"ward.D2\")\n",
    "plot(hc1, main = \"Дендрограмма (Euclidean + Ward)\", labels = FALSE, hang = -1, sub=\"\")\n",
    "rect.hclust(hc1, k=4, border=\"red\") # Примерное разбиение\n",
    "\n",
    "d2 <- dist(X_scaled, method = \"manhattan\")\n",
    "hc2 <- hclust(d2, method = \"ward.D2\")\n",
    "plot(hc2, main = \"Дендрограмма (Manhattan + Ward)\", labels = FALSE, hang = -1, sub=\"\")\n",
    "rect.hclust(hc2, k=4, border=\"blue\")\n"
   ]
  },
