   "source": [
    "# Загрузка библиотек\n",
    "library(tidyverse)\n",
    "library(cluster)\n",
    "library(factoextra)\n",
    "\n",
    "# Загрузка данных\n",
    "attendance <- read_csv(\"/kaggle/input/school-student-daily-attendance/2018-2019_Daily_Attendance_20240429.csv\")\n",
    "\n",
    "# 1. Feature Engineering и Агрегация\n",
    "school_summary <- attendance %>%\n",
    "  mutate(\n",
    "    # Создаем относительный показатель отсутствия (доля от зачисленных)\n",
    "    Absent_Rate = Absent / Enrolled\n",
    "  ) %>%\n",
    "  group_by(`School DBN`) %>%\n",
    "  summarise(\n",
    "    Avg_Enrolled = mean(Enrolled, na.rm = TRUE),\n",
    "    Avg_Absent_Rate = mean(Absent_Rate, na.rm = TRUE),\n",
    "    # Добавляем вариативность посещаемости (стабильность школы)\n",
    "    SD_Absent_Rate = sd(Absent_Rate, na.rm = TRUE)\n",
    "  ) %>%\n",
    "  ungroup() %>%\n",
    "  na.omit() # Убираем строки, если где-то sd дал NA (одиночные записи)\n",
    "\n",
    "# 2. Масштабирование (Scaling)\n",
    "# Обязательно для кластеризации, чтобы численность (сотни) не доминировала над процентами (0.05)\n",
    "school_scaled <- school_summary %>%\n",
    "  select(-`School DBN`) %>%\n",
    "  scale() %>%\n",
    "  as.data.frame()\n",
    "\n",
    "# Добавляем названия школ как имена строк для удобства\n",
    "rownames(school_scaled) <- school_summary$`School DBN`\n",
    "\n",
    "# 3. Проверка результата\n",
    "print(paste(\"Количество школ для кластеризации:\", nrow(school_scaled)))\n",
    "head(school_scaled)\n",
    "summary(school_scaled)\n",
    "\n",
    "# 4. Проверка корреляций (важно, чтобы не кластеризовать по дублирующим признакам)\n",
    "cor(school_scaled)\n"
   ]
  },
