   "source": [
    "set.seed(123) # Для воспроизводимости\n",
    "\n",
    "# 1. Метод локтя (Elbow Method)\n",
    "# Ищем точку перегиба, где падение ошибки замедляется\n",
    "fviz_nbclust(school_scaled, kmeans, method = \"wss\") +\n",
    "  labs(title = \"Метод локтя (Within Sum of Squares)\")\n",
    "\n",
    "# 2. Метод силуэта (Silhouette Method)\n",
    "# Ищем пик, где кластеры максимально плотные и разделенные\n",
    "fviz_nbclust(school_scaled, kmeans, method = \"silhouette\") +\n",
    "  labs(title = \"Метод силуэта (Average Silhouette Width)\")\n",
    "\n",
    "# 3. Gap Statistic (статистика разрыва)\n",
    "# Сравнивает нашу кластеризацию со случайным распределением\n",
    "gap_stat <- clusGap(school_scaled, FUN = kmeans, nstart = 25,\n",
    "                    K.max = 10, B = 50) # B = 50 итераций bootstrap\n",
    "\n",
    "fviz_gap_stat(gap_stat) +\n",
    "  labs(title = \"Gap Statistic Method\")\n"
   ]
  },
