   "source": [
    "set.seed(123)\n",
    "\n",
    "# --- 1. K-Means Clustering ---\n",
    "kmeans_model <- kmeans(school_scaled, centers = 4, nstart = 25)\n",
    "\n",
    "# --- 2. Hierarchical Clustering (Ward) ---\n",
    "dist_matrix <- dist(school_scaled, method = \"euclidean\")\n",
    "hc_ward <- hclust(dist_matrix, method = \"ward.D2\")\n",
    "grp_ward <- cutree(hc_ward, k = 4)\n",
    "\n",
    "# --- 3. Hierarchical Clustering (Single Linkage) ---\n",
    "# Проверяем \"плохой\" метод для отчета\n",
    "hc_single <- hclust(dist_matrix, method = \"single\")\n",
    "grp_single <- cutree(hc_single, k = 4)\n",
    "\n",
    "# --- 4. Оценка качества (Silhouette Score) ---\n",
    "# Функция для быстрого расчета среднего силуэта\n",
    "get_sil_score <- function(model_clusters, data_dist) {\n",
    "  ss <- silhouette(model_clusters, data_dist)\n",
    "  mean(ss[, 3])\n",
    "}\n",
    "\n",
    "scores <- data.frame(\n",
    "  Method = c(\"K-Means\", \"Hierarchical (Ward)\", \"Hierarchical (Single)\"),\n",
    "  Silhouette = c(\n",
    "    get_sil_score(kmeans_model$cluster, dist_matrix),\n",
    "    get_sil_score(grp_ward, dist_matrix),\n",
    "    get_sil_score(grp_single, dist_matrix)\n",
    "  )\n",
    ")\n",
    "\n",
    "print(scores)\n",
    "\n",
    "# --- 5. Визуализация лучшей модели (обычно K-means или Ward) ---\n",
    "# Рисуем K-means для детального разбора\n",
    "fviz_cluster(kmeans_model, data = school_scaled,\n",
    "             geom = \"point\",\n",
    "             ellipse.type = \"convex\", \n",
    "             ggtheme = theme_minimal()) +\n",
    "  labs(title = \"Результат кластеризации K-Means (k=4)\")\n",
    "\n",
    "# Смотрим, сколько школ попало в каждый кластер (проверка баланса)\n",
    "table(kmeans_model$cluster)\n"
   ]
  },
