   "source": [
    "# Прикрепляем метки кластеров к исходным данным (до масштабирования)\n",
    "final_data <- school_summary %>%\n",
    "  mutate(Cluster = factor(kmeans_model$cluster))\n",
    "\n",
    "# Считаем средние показатели для каждого кластера\n",
    "cluster_profiles <- final_data %>%\n",
    "  group_by(Cluster) %>%\n",
    "  summarise(\n",
    "    Count = n(), # Сколько школ в группе\n",
    "    Avg_Enrolled = mean(Avg_Enrolled), # Средний размер\n",
    "    Avg_Absent_Rate = mean(Avg_Absent_Rate), # Средний процент пропусков\n",
    "    Stability = mean(SD_Absent_Rate) # Стабильность\n",
    "  ) %>%\n",
    "  mutate(\n",
    "    # Переводим в понятные проценты\n",
    "    Avg_Absent_Percent = round(Avg_Absent_Rate * 100, 1),\n",
    "    # Даем предварительные названия (вы можете их поменять по смыслу)\n",
    "    Description = case_when(\n",
    "      Avg_Absent_Percent < 5 ~ \"Элитные / Дисциплинированные\",\n",
    "      Avg_Absent_Percent > 15 ~ \"Проблемные\",\n",
    "      Avg_Enrolled > 1000 ~ \"Гигантские школы\",\n",
    "      TRUE ~ \"Типичные средние\"\n",
    "    )\n",
    "  )\n",
    "\n",
    "print(cluster_profiles)\n",
    "\n",
    "# Визуализация профилей (Boxplot)\n",
    "# Чтобы показать разницу в пропусках между группами\n",
    "final_data %>%\n",
    "  ggplot(aes(x = Cluster, y = Avg_Absent_Rate, fill = Cluster)) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Распределение пропусков по кластерам\",\n",
    "       y = \"Доля отсутствующих (0.1 = 10%)\") +\n",
    "  theme_minimal()\n"
   ]
  },
