   "source": [
    "Три метода выбора количества кластеров дали одинаковый результат, 4 кластера. Потому были протестированы три метода кластеризации и оценен их коэффициент силуета. Single Linkage дал самый большой коэффициент, но он втупую выбросы засунул в отдельные кластеры и все, такое мы осуждаем, остановился на kmeans, он адекватнее интерпретируется здесь. \n",
    "Первый кластер - маленькие школы, с ужасной посещаемостью (в среднем отутствует 40% учеников. Может я накосячил где?). Стабильность прогулов тоже скачет\n",
    "Второй - школы относительно большие школы, с минимальным количеством пропусков и стабильной посещаемостью\n",
    "Третий - средние школы, с относительно средней посещаемостью и средней стабильностью\n",
    "Четвертый - огромные школы, с посещаемостью лучше среднего и стабильностью посещаемости лучше среднего.\n"
   ]
  },
