   "source": [
    "library(tidyverse)\n",
    "library(lubridate)\n",
    "library(cluster)\n",
    "library(factoextra)\n",
    "\n",
    "# Загрузка\n",
    "df <- read_delim(\"/kaggle/input/customermarketing/Customer marketing.csv\", delim = \"\\t\") # Внимание! Обычно этот файл с табуляцией\n",
    "\n",
    "# Feature Engineering\n",
    "df_clean <- df %>%\n",
    "  mutate(\n",
    "    Age = 2025 - Year_Birth, # Актуальный год\n",
    "    Total_Spent = MntWines + MntFruits + MntMeatProducts + MntFishProducts + MntSweetProducts + MntGoldProds,\n",
    "    Family_Size = 1 + ifelse(Marital_Status %in% c(\"Married\", \"Together\"), 1, 0) + Kidhome + Teenhome,\n",
    "    Is_Parent = ifelse(Kidhome + Teenhome > 0, 1, 0)\n",
    "  ) %>%\n",
    "  filter(Age < 100, Income < 600000) %>% # Удаляем явные выбросы (возраст > 100, доход > 600k)\n",
    "  drop_na() # Удаляем пустые значения (обычно их мало в Income)\n",
    "\n",
    "# Отбираем только нужные числовые колонки для кластеризации\n",
    "# Убираем ID, даты и категориальные (кроме созданных нами)\n",
    "df_clustering <- df_clean %>%\n",
    "  select(Income, Recency, Age, Total_Spent, Family_Size, \n",
    "         NumWebPurchases, NumStorePurchases, NumDealsPurchases)\n",
    "\n",
    "# Масштабирование\n",
    "df_scaled <- scale(df_clustering)\n",
    "\n",
    "# Проверка\n",
    "print(paste(\"Осталось клиентов:\", nrow(df_scaled)))\n",
    "summary(df_clustering)\n",
    "cor(df_clustering)\n"
   ]
  },
