   "source": [
    "Здесь был литл фьючер инжениринг. Людей объединили по группам, с этим работать будет проще. Категории трат засунули в одну, потому что нам отдельные категории не нужны. Колонки с данными о числе взрослых и детей в семье также объединили, потому что поведенческие паттерны у семей с разным размером разные. Все что не нужно для решения задачи убрали. Масштабировали доход, чтобы он не задавил другие признаки. \n",
    "Доход и сумма трат имеют сильную корреляцию. Очевидно почему.\n",
    "Размер семьи негативно коррелирует с тратами, что странно, но информации о происхождении датасета нет, поэтому терпим.\n",
    "Еще есть хорошие корреляции между количечством покупок в разных типах магазинов"
   ]
  },
