   "source": [
    "# 1. Запуск PCA\n",
    "pca_res <- prcomp(df_scaled, center = FALSE, scale. = FALSE) # Данные уже отмасштабированы\n",
    "\n",
    "# 2. Визуализация важности компонент (Scree Plot)\n",
    "fviz_eig(pca_res, addlabels = TRUE, ylim = c(0, 50)) +\n",
    "  labs(title = \"Scree Plot: Сколько информации несет каждая компонента?\")\n",
    "\n",
    "# 3. Что внутри компонент? (Вклад признаков)\n",
    "fviz_pca_var(pca_res, col.var = \"contrib\",\n",
    "             gradient.cols = c(\"#00AFBB\", \"#E7B800\", \"#FC4E07\"),\n",
    "             repel = TRUE) +\n",
    "  labs(title = \"Вклад переменных в главные компоненты\")\n",
    "\n",
    "\n",
    "\n"
   ]
