   "source": [
    "\n",
    "\n",
    "# Берем 4 компоненты (покрываем ~80% дисперсии)\n",
    "df_pca_4 <- as.data.frame(pca_res$x[, 1:4])\n",
    "\n",
    "set.seed(42)\n",
    "\n",
    "# 1. Выбор k (Elbow и Silhouette) на 4 компонентах\n",
    "p1 <- fviz_nbclust(df_pca_4, kmeans, method = \"wss\") + labs(title = \"Elbow Method (4 PCs)\")\n",
    "p2 <- fviz_nbclust(df_pca_4, kmeans, method = \"silhouette\") + labs(title = \"Silhouette Method (4 PCs)\")\n",
    "\n",
    "# Выводим графики выбора k\n",
    "print(p1)\n",
    "print(p2)\n",
    "\n",
    "# 2. Кластеризация (k определим по графикам, пока ставим 4 как гипотезу)\n",
    "final_k <- 4\n",
    "kmeans_final <- kmeans(df_pca_4, centers = final_k, nstart = 25)\n",
    "\n",
    "# 3. Визуализация (показываем проекцию на первые 2 оси, но кластеры считались в 4D)\n",
    "fviz_cluster(kmeans_final, data = df_pca_4,\n",
    "             choose.vars = c(\"PC1\", \"PC2\"), # Явно указываем оси для рисовки\n",
    "             geom = \"point\",\n",
