   "source": [
    "\n",
    "\n",
    "# Добавляем метки кластеров к исходным данным\n",
    "df_clean$Cluster <- factor(kmeans_final$cluster)\n",
    "\n",
    "# Считаем средние показатели для каждого кластера\n",
    "cluster_summary <- df_clean %>%\n",
    "  group_by(Cluster) %>%\n",
    "  summarise(\n",
    "    Count = n(),\n",
    "    Income = mean(Income),\n",
    "    Total_Spent = mean(Total_Spent),\n",
    "    Age = mean(Age),\n",
    "    Family_Size = mean(Family_Size),\n",
    "    Deals = mean(NumDealsPurchases),\n",
    "    Web = mean(NumWebPurchases),\n",
    "    Store = mean(NumStorePurchases)\n",
    "  ) %>%\n",
    "  arrange(desc(Total_Spent)) # Сортируем от богатых к бедным\n",
    "\n",
    "print(cluster_summary)\n",
    "\n",
    "# Визуализация дохода по кластерам (чтобы увидеть разницу)\n",
    "df_clean %>%\n",
    "  ggplot(aes(x = Cluster, y = Total_Spent, fill = Cluster)) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Траты по сегментам\", y = \"Сумма трат за 2 года\") +\n",
    "  theme_minimal()\n"
   ]
  },
